import "./ProjectsSection.css";
import React from "react";
import Button from "react-bootstrap/Button";
import img from "../../images/FGlogo.png";
import { Col, Row } from "react-bootstrap";

const ProjectsSection = ({}) => {
  return (
    <section className="projects-summary" id="projects-summary">
      <h1>Some of my Projects</h1>
      <Row className="projects">
        <Col xs="12" sm="12" md="6" className="project">
          <img src={img} className="image" alt="..." />
          <div className="overlay" />
          <h3 className="middle">
            Project Name <br />
            <a className="" href={"/projects/p1"}>
              Tell Me More
            </a>
          </h3>
        </Col>
        <Col xs="12" sm="12" md="6" className="project">
          <img src={img} className="image" alt="..." />
          <div className="overlay" />
          <h3 className="middle">
            Project Name <br />
            <a className="" href={"/projects/p2"}>
              Tell Me More
            </a>
          </h3>
        </Col>
        <Col xs="12" sm="12" md="6" className="project">
          <img src={img} className="image" alt="..." />
          <div className="overlay" />
          <h3 className="middle">
            Project Name <br />
            <a className="" href={"/projects/p3"}>
              Tell Me More
            </a>
          </h3>
        </Col>
        <Col xs="12" sm="12" md="6" className="project">
          <img src={img} className="image" alt="..." />
          <div className="overlay" />
          <h3 className="middle">
            Project Name <br />
            <a className="" href={"/projects/p4"}>
              Tell Me More
            </a>
          </h3>
        </Col>
      </Row>
      <Button className="view-all-btn" variant="secondary" size="lg">View All</Button>
    </section>
  );
};

const ProjectLeft = ({}) => {
  return <div></div>;
};

const ProjectRight = ({}) => {
  return <div></div>;
};

export default ProjectsSection;
